Verenigd Koninkrijk
Misdaad / Thriller
111 minuten

goeie film

met Jason Statham, Saffron Burrows en Stephen Campbell Moore

In september 1971 groef een bende dieven een tunnel onder de Baker Street bank in Londen en ging er vandoor met drie miljoen 
pond aan juwelen en cash. Niemand werd ooit gearresteerd en de buit nooit teruggevonden. De hele zaak werd door de overheid in 
de doofpot gestopt en nu pas onthuld: een verhaal waarin blijkt dat de dieven niet de enige criminelen zijn en waar moord, een 
seksschandaal en de Koninklijke familie deel van uitmaakten.
